import React, { Component } from "react";
import { GridList, Container } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <GridList cellHeight={160} style={{}}>
          {["red", "yellow"].map(color => {
            <Container style={{ color: color }}></Container>;
          })}
        </GridList>
      </div>
    );
  }
}

export default Cart;
